css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("bitsoup.org") {

body {background: #222!important;
margin-left:10px!important;margin-right: 10px!important;
margin-top:10px!important;margin-bottom:10px!important;
border:1px solid #333!important;padding:5px!important;}

body,table,tbody,tr,td,span,p,b,textarea,input,form,div,pre {font-family: "helvetica", "sans-serif"!important;}

body,table,tbody,tr,td,span,p,textarea,input,form,div,pre {font-size: 11px!important;}

body,table,tbody {color: #bbb!important;}

table,table.statusbar,
table.menubar{background:#333!important;padding:0!important;border:0!important;width:100%!important;}

input, select, textarea {font-size: 11px!important;color:#000!important;background-color:white!important}
li {margin-top: 8px!important;margin-bottom: 6pt!important;}
ul {margin-left: 18px!important;margin-top: 0px!important;margin-bottom: 0px!important;}
h1 {font-size: 14px!important;padding:8px 0 0 0!important;}
h2 {font-size: 12px!important;margin-bottom: 6px!important;}
p {text-align:right!important;}
p.sub {text-align:left!important;margin: 12px 0px 2px 8px!important;}
form {margin-top: 0!important;margin-bottom: 0!important;background:inherit!important}
hr {color:#E0850A!important;}
blockquote {color:#fc3!important;} em {color:#000!important}
li,ul {color:#fc3!important}li>b {color:#aaa!important}
p>a:link {color:#fc3!important;text-decoration:underline!important;}
font[color="#0000ff"]{color:#fc3!important;}
font[color="black"],font[color="#000000"]{color:#ccc!important;}
font[color="#1900d1"]{color:#3ac!important;}
font[color="blue"]{color:#3ac!important;}font[color="darkblue"]{color:#39f!important;}
font.gray {text-decoration:none!important;}
font.small[size="1"] {float:left!important;color:#ca3!important;font-size:inherit!important;}
nobr {float:left!important; padding-left:20px!important}
textarea[name="msg_problem"]{width:100%!important;opacity: 0.6!important;font-size:16px!important;}
textarea[name="body"] {width:100%!important;font-size:16px!important;}
select[name="incldead"]{position:absolute!important;top:200px!important;right:20px!important;}
select[name="blah"]{position:absolute!important;top:224px!important;right:20px!important;}
input[class="btn"][value="Go!"]{position:absolute!important;top:244px!important;right:20px!important;}
input[value="New topic"][class="btn"],input[value="Add Reply"][class="btn"]{position:absolute!important;top:192px!important;right:15px!important;}
input[value="View unread"][class="btn"],input[value="View Unread"][class="btn"]{position:absolute!important;top:192px!important;right:95px!important;}
td>font[color="#000000"]{float:left!important;white-space:nowrap!important;}

a:link[href*="?action"],a:visited[href*="?action"]{color:#da3!important}
a:hover[href*="?action"]{color:#ccc!important;text-decoration:underline!important;}

a:link, a:visited {text-decoration: none!important;color: #aaa!important;}
a:hover {color: #f90!important;}
a.catlink {font-size: 11px!important;padding-right:0!important;padding-top:0!important;padding-left:5px!important;padding-bottom:0!important;color:#bbb!important}

th {font-size: 10px!important;border: solid #000 1px!important;}
table.donate {border:0!important;background:transparent!important;}
table.koptekst {background: #444!important;width:100%!important;}	
table.main {background: #444 !important;padding:2px!important;}
table.menu {width:100%!important;}
table.stats {background: #303231!important;}
table.mainouter {background: #0f0!important;width:100%!important;}
table.bottom {background: #222!important;padding:0!important;border:0!important}
table.list {width:100%!important;padding:0!important;border-right:0!important;border-left:0!important;}
table.infotable {background: #333!important;text-align:center!important;}
div {width:100%}
td.colhead {background: #444!important;}
td.rowhead {vertical-align: middle!important; padding: 3px!important;}
td.heading, td.rowhead {background:#444!important}
td.main {padding:0!important;margin:0!important;background:#222!important;}
td {font-size: 8pt!important;border: solid #222 1px!important;}
td.menubar {background: #222!important;}
td.embedded {background: #333!important;padding:2px!important;text-align: right!important;border:1px solid #333!important;}
td.embedded1,td.embedded2 {background: inherit!important;border: 0!important;padding: 0!important;text-align: left!important;}
td.mainouter {background: inherit!important;}
td.bottom {background: #222!important;border: none!important;padding:5px!important;}
td.text {padding: 12px!important;text-align: left!important;background:#444!important;}
td.comment {background: #222!important;padding: 10px!important;font-size: 12px!important;text-align: left!important;}
td.statusbar {background: #0ff!important;}
td.rules {background: #444!important;}
td.title {font-size: 14px!important;}
td.navigation {font-size: 11px!important;border:0!important;font-weight: bold!important;padding:6px 0 6px 0!important;}
td.navigation2 {background:inherit!important;border: none!important;}	
td.clear {padding: 0!important;border: 0!important;background: transparent!important;}		




img[src*="pic/buddylist.gif"]{opacity:0.7!important;}
img:hover[src*="pic/buddylist.gif"]{opacity:1.0!important;}
img[src*="pic/pn_inbox.gif"],[src*="pic/pn_sentbox.gif"] {height:9px!important;}


/****** Edit Background URL Below to another image if desired ******
div[width="100%"][align="center"] {height:145px!important;width:1200px!important; background-image:URL(http://photo-hosting.winsoftmagic.com/1/zcok793x40.jpg) !important;}

img[src*="pic/logo.gif"]{display:none; !important}



img[src*="pic/unlocked.gif"],img[src*="pic/unlockednew.gif"],img[src*="pic/locked.gif"],img[src*="pic/lockednew.gif"] {height:28px!important;float:left!important;}
img.border  {border:0!important;}
img[src*="pic/hdbanner.jpg"],[src*="pic/donate_browse.gif"],[src*="pic/x-click-but04.gif"]{display:none!important} /* Set opacity for banners & helpdesk image */
img:hover[src*="pic/donate_browse.gif"]{opacity:0.7!important} /* Hover for donation banner */
img:hover[src*="pic/x-click-but04.gif"]{opacity:0.9!important} /* Hover for paypal button */
img[src*="http://static.bitsoup.org/pic/cat-"] {opacity:0.8!important} /* Set some transparency on catergory images */

/****** TO HIDE BANNERS DELETE THIS LINE & NO.2 ******

img[src*="pic/hdbanner.jpg"],[src*="pic/donate_browse.gif"],[src*="pic/x-click-but04.gif"]{display:none!important} 

*************** THIS IS LINE NO.2 ***************/


div:hover[width="100%"][align="center"] {opacity:0.7!important;}





/* Replace wishlist/bookmark icon */
img[src*="pic/bookmark.gif"]{width:0!important;height: 21px !important;
padding-left:21px!important;padding-right:0!important;
padding-top:0!important;padding-bottom:0!important;
background:url("data:image/gif;base64,") transparent!important;}

/* Replace default avatar image */
img[src*="pic/default_avatar.gif"]{
width: 0px!important;height: 150px !important;
padding-left:150px!important;padding-right:0!important;
padding-top:0!important;padding-bottom:0!important;
background: url("data:image/jpg;base64,") transparent!important;
}


}
